■ジャズマスターラトラパンテ　世界限定365本モデル　■<br>
ハミルトンで最上位モデルとなるジャズマスターラトラパンテのご紹介です。重厚で美麗な文字盤に、職人の技が光る伝統技術とモダニズムを融合させた、フラッグシップモデルの誕生です。ラトラパンテとは、スプリットセコンド・クロノグラフ機能を備えたウオッチです。一方の秒針をもう一方の秒針上に重ねた2本の計測用秒針配置されており、ラップタイムの計測やレースでの２人の競技者の中間タイムなどを個々に計測することが可能です。精密なムーブメントの性質に反するスタイリッシュな装いが魅力のひとつでもあります。滑らかなステンレススチールの仕上げと、スイスの伝統を誇る　コード・ジュネーブ　による美しい文様の文字盤の装飾は、エレガントでクラシカルな印象を与えてくれます。対照的に、メタリックの無機質なインダイアルを異なるサイズで不均一に配置、アバンギャルドでクールな一面も併せ持っています。絶妙に均整の取れた見事な外観は、伝統を昇華させた気品を感じさせます。一言で言うと、オーラのある時計です。ハミルトンの中でも、このモデルはかなりのものです。そして、このお値段設定では通常は考えられないような機械を採用しています。ここがこのモデルの一番のポイントです。この機械は、他のブランドや他のメーカーですと数百万円をつけているところもあるそうです。この、ハミルトンの長い歴史に残る貴重な１本になるラトラパンテ。１年365日ということで限定365本、誕生した日付が刻印されています。
<br><br>

