【ご注文より1～2ヶ月にてお届け】<br><br>

カーキネイビーパイオニア限定モデル　H78719553
1940年代の米海軍用マリンクロノメーターが ブランド誕生120周年を記念して登場。1892年に誕生して以来、ハミルトンは、陸・海・空すべてのフィールドでアメリカの発展と共に歩んできました。中でもハミルトンの歴史を語るうえで欠かすことができないのが、1940年代にアメリカ海軍の要請で開発された「マリンクロノメーター」。後にハミルトンが数多くの軍用時計を手掛ける礎となった伝説の時計が、ブランド誕生120周年を記念し、 “Khaki Navy Pioneer ‐海の開拓者”として蘇ります。世界限定1892本の限定モデルは、当時のマリンクロノメーターと同様にウッドボックスにセットして楽しめるほか、置き時計や腕時計としても使用できるユニークな仕様になっています。つまり3種類の楽しみ方が出来るのです。ムーブメントには、ハミルトンのルーツであるポケットウォッチで使用されるムーブメントを採用。
コート・ド・ジュネーブの美しい装飾をシースルーの裏蓋から見ることができます。 <br><br>

