2011年バーゼルでの発表以来、日本でも予約注文が殺到した2011年限定モデルの「パンユーロ」。入手困難モデルとして話題を呼んだパンユーロが、今年は、1970年代のアーカイブからインスパイアを受けたシックな文字盤カラーで登場しました。新色のパン・ユーロ。どちらの色が人気ありますか？と言うお問い合わせが多いのですが、不思議な事にどちらも同じくらいです。黒は赤針との組み合わせがとても良く、締まった感じもしますしスーツ等にも合わせやすいです。シルバーは、実にハミルトンらしい組み合わせだなあと思います。どの色もオリジナルのパン・ユーロにも存在していた色でしたが、
40年前からハミルトンは面白い時計を作っていたんだなあと、あらためて実感しています。パワーリザーブ60時間も、パン・ユーロの魅力の一つです。 <br><br>
